import{_ as t,c as r,o as n,ae as i}from"./chunks/framework.Dh1jimFm.js";const p=JSON.parse('{"title":"FiveM Server","description":"Der Roleplay.net FiveM Server","frontmatter":{"title":"FiveM Server","description":"Der Roleplay.net FiveM Server"},"headers":[],"relativePath":"pages/fivem.md","filePath":"pages/fivem.md"}'),a={name:"pages/fivem.md"};function s(l,e,d,o,c,h){return n(),r("div",null,e[0]||(e[0]=[i('<h1 id="der-fivem-server" tabindex="-1">Der FiveM Server <a class="header-anchor" href="#der-fivem-server" aria-label="Permalink to &quot;Der FiveM Server&quot;">​</a></h1><div class="warning custom-block"><p class="custom-block-title">Achtung!</p><p>Der Server ist nur für Spieler über 15 Jahre verfügbar!</p></div><p>Unser FiveM Server spielt im Gegensatz zu unserem Minecraft Server in der heutigen Zeit. Der Staat Infinity hat neues Land eingenommen, dazu gehört auch die Kolonialstadt Los Santos. Ein Jahrhundert später ist Los Santos eine gigantische Stadt und immernoch unter der Kontrolle von Infinity. Die ICA (Infinity State Agency) Leitet die Behörden und sorgt für Ordnung.</p><p>Egal ob legal oder illegal, auf Roleplay.net kannst du die Geschichte deines Charakters neu erfinden und die Möglichkeiten des Roleplays auslasten. Verschiedenste und großteils selbst angepasste Mods ermöglichen noch besseres Roleplay in den verschiedensten Branchen. Egal ob als Anwalt, Politiker, Müllmann oder Mafioso, hier kannst du die Geschichte deines Charakters selbst gestalten.</p><h2 id="mods" tabindex="-1">Mods <a class="header-anchor" href="#mods" aria-label="Permalink to &quot;Mods&quot;">​</a></h2><p>Egal ob Spielverändernde Scripts, Autos oder Gebäude, wir verändern alles um das bestmögliche Spielerlebnis zu gestalten. Beispiele hierfür sind:</p><table tabindex="0"><thead><tr><th style="text-align:center;">Mod</th><th style="text-align:center;">Beschreibung</th></tr></thead><tbody><tr><td style="text-align:center;">myEmergency</td><td style="text-align:center;">Ein Verwaltungssysten für Behörden und Mediziner</td></tr><tr><td style="text-align:center;">Quasar Phone</td><td style="text-align:center;">Ein voll funktionierendes Handy</td></tr><tr><td style="text-align:center;">Add-On Autos</td><td style="text-align:center;">Selbst angepasste Models und Skins</td></tr><tr><td style="text-align:center;">PMA Voice Chat</td><td style="text-align:center;">Realistischer Sprachchat</td></tr></tbody></table><p>...und vieles mehr!</p><h2 id="beitritt" tabindex="-1">Beitritt <a class="header-anchor" href="#beitritt" aria-label="Permalink to &quot;Beitritt&quot;">​</a></h2><p>Du möchtest auf dem Server spielen? Super! Du findest uns in der FiveM Serverliste. Solltest du doch noch Schwierigkeiten haben uns zu finden, Stell deinen Suchfilter auf die Sprache &quot;Deutsch&quot;, oder gib in der Suchleiste einfach &quot;Roleplay.net&quot; ein.</p>',10)]))}const g=t(a,[["render",s]]);export{p as __pageData,g as default};
